import React, {useState} from 'react';
import { motion } from "framer-motion"
import { CardBody } from '@material-tailwind/react';



function App() {
  const [occupied, setOccupied] = useState(false)
  return (
    <div className='flex-initial align-content-center bg-gradient-to-r to-[#5fe0b7] from-[#154734] w-screen h-screen'>
      <motion.div 
      onClick={() => {
        setOccupied(!occupied)
      }}
      whileTap={{ scale: 0.8 }} 
      className=""
      >
        {occupied && <h1 className='font-semibold text-white'>Occupied</h1>}
        {!occupied && <h1 className='font-semibold text-white'>Empty</h1>}
        <img src={require('./utdvectorwhite.png')} />
      </motion.div>
    </div>
  );
}


